import React, { Component } from 'react'
import '../App.css'
import '../Rsvp.css'
import Button from '@material-ui/core/Button'


class Guest extends Component {

    render() {
        const {name, attending} = this.state
        return (
            <div>
                <h4 className='playfair center'>{name}</h4>
                <Button name='rsvp' variant={attending ? 'contained' : 'outlined'} >RSVP</Button>
                <Button name='norsvp' variant={attending ? 'outlined':'contained'} >Not Going</Button>
            </div>
        )
    }
}

export default Guest
